    thresholdvalues = [float(re.match("""([-+]?[0-9]*\.?[0-9]+([eE][-+]?[0-9]+)?)""", x.split(",")[0]).groups()[0]) for x in l[3].split("(")[1:]]
    lossvalues = [float(re.match("""([-+]?[0-9]*\.?[0-9]+([eE][-+]?[0-9]+)?)""", x.split(",")[1]).groups()[0]) for x in l[3].split("(")[1:]]
    return (lossvalues,thresholdvalues)

